import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
	background-image: url('assets/images/home-bg.png');
	background-repeat: no-repeat;
	background-position: center;
	height: 800px;
	text-align: center;
`;

const ButtonAndLogoSection = styled.div`
	position: relative;
	top: 645px;
`;

const Button = styled.button`
	color: #f2f2f2;
	background: rgba(242, 242, 242, 0.1);
	font-size: 23px;
	font-family:  cera_proregular, Arial, Helvetica, sans-serif;
	padding: 20px 60px;
	border: 1px solid #f2f2f2;
	border-radius: 35px;
	cursor: pointer;
	display: block;
	margin-left: auto;
	margin-right: auto;
	margin-bottom: 20px;
`;

const home = ( props ) => (
	<Container>
		<ButtonAndLogoSection>
			<button>tap to begin</button>
			<img src="assets/images/cox-logo-gradient.png" alt="Cox logo"/>
		</ButtonAndLogoSection>
	</Container>
)

export default home;
